import React from 'react';

class ProjectsIndex extends React.Component {
  render() {
    return (
        <div className="b-content container">
          <h1>Projects</h1>
          <p>
            Let's do something awesome here!
          </p>
        </div>
    );
  }
}

export default ProjectsIndex;
